DROP FUNCTION IF EXISTS `get_daishenwei_username_func`;
DELIMITER //
CREATE DEFINER=`oldcatm`@`%` FUNCTION `get_daishenwei_username_func`(loanOrderID VARCHAR(100)) RETURNS varchar(1000) CHARSET utf8
BEGIN
DECLARE userIds VARCHAR(1000);
SELECT
	GROUP_CONCAT(ASSIGNEE) INTO userIds FROM	t_bp_loan_order_his
	WHERE	ROLE_ID = (	SELECT ROLE_ID FROM t_role WHERE ROLE_CODE = 'IPCDaiShenWei' )
	AND LOAN_ORDER_ID = loanOrderID;
RETURN userIds;
END//
DELIMITER ;


-- 导出  函数 qqms.get_dict_code_func 结构
DROP FUNCTION IF EXISTS `get_dict_code_func`;
DELIMITER //
CREATE DEFINER=`oldcatm`@`%` FUNCTION `get_dict_code_func`(v_parent_type VARCHAR(100),v_dict_code VARCHAR(100)) RETURNS varchar(100) CHARSET utf8
BEGIN 
	DECLARE sChildList VARCHAR(100); 
	SELECT a1.dict_name INTO sChildList FROM qqms.`t_sys_dict` a1 WHERE a1.parent_id IN(
	SELECT code_id FROM qqms.`t_sys_dict` WHERE dict_code = v_parent_type) AND a1.DICT_CODE=v_dict_code;
	RETURN sChildList;
    END//
DELIMITER ;


-- 导出  函数 qqms.get_org_by_region 结构
DROP FUNCTION IF EXISTS `get_org_by_region`;
DELIMITER //
CREATE DEFINER=`oldcatm`@`%` FUNCTION `get_org_by_region`(orgId INT,region CHAR(100)) RETURNS int(11)
BEGIN
	DECLARE resOrgId INT;
	DECLARE tempRegion CHAR(100);
	DECLARE tempOrgId INT;
	SET tempOrgId = orgId,tempRegion='-';
	WHILE tempRegion <> region DO
		SELECT 
			tor.ORGANIZATION_ID, tor.REGION_TYPE, tor.PID 
		INTO resOrgID, tempRegion, tempOrgId 
		FROM t_organization tor 
		WHERE tor.ORGANIZATION_ID  =  tempOrgId;
	END WHILE;
	RETURN resOrgId;
END//
DELIMITER ;


-- 导出  函数 qqms.get_org_name_by_userId 结构
DROP FUNCTION IF EXISTS `get_org_name_by_userId`;
DELIMITER //
CREATE DEFINER=`root`@`%` FUNCTION `get_org_name_by_userId`(`userId` INT) RETURNS char(100) CHARSET utf8
BEGIN
	DECLARE tmp_Org_PId INT;
	DECLARE res_dept_name CHAR(100) DEFAULT '';	
	DECLARE newly_found_dept_name CHAR(100) DEFAULT ''; -- 每次执行查询后，得出的地区或者部门名字	
	DECLARE userOrgId INT;	
-- 根据userId，查询该User的orgId
	SELECT t_u.ORGANIZATION_ID 
	INTO userOrgId
	FROM t_users t_u WHERE t_u.USER_ID = userId;
	
	-- WHILE tempOrgId IS NOT NULL DO
	WHILE userOrgId != 1 DO                           -- "1" 为“t_organization”数据库表中，“财富管理中心”的PID。
			SELECT
				tor.PID, tor.FULL_NAME
			INTO	
				tmp_Org_PId, newly_found_dept_name
			FROM t_organization tor 
			WHERE tor.ORGANIZATION_ID  =  userOrgId;
			SET userOrgId = tmp_Org_PId;
			SET res_dept_name = CONCAT(newly_found_dept_name, res_dept_name);
	END WHILE;				
	RETURN res_dept_name;
END//
DELIMITER ;


