-- 导出  函数 qqms.get_userName_by_roleCode_and_investOrderId 结构
DROP FUNCTION IF EXISTS `get_userName_by_roleCode_and_investOrderId`;
DELIMITER //
CREATE DEFINER=`root`@`%` FUNCTION `get_userName_by_roleCode_and_investOrderId`(investOrderId VARCHAR (50), roleCode VARCHAR (50)) RETURNS varchar(50) CHARSET utf8
BEGIN
  DECLARE rtnValue VARCHAR (100) ;
  SELECT 
    t_users.USER_NAME INTO rtnValue 
  FROM
    (SELECT 
      ASSIGNEE_ 
    FROM
      act_hi_taskinst 
    WHERE 1 = 1 
      AND TASK_DEF_KEY_ IN (roleCode) 
      AND proc_inst_id_ = 
      (SELECT 
        proc_inst_id_ 
      FROM
        act_hi_procinst 
      WHERE business_key_ = CONCAT(
          'InvestRedeemProcess.',
          investOrderId
        ))) t_workflow 
    LEFT JOIN t_users 
      ON t_users.USER_ID = t_workflow.assignee_ ;
  RETURN rtnValue ;
END//
DELIMITER ;


-- 导出  函数 qqms.get_user_name_func 结构
DROP FUNCTION IF EXISTS `get_user_name_func`;
DELIMITER //
CREATE DEFINER=`oldcatm`@`%` FUNCTION `get_user_name_func`(userIds VARCHAR(1000)) RETURNS varchar(1000) CHARSET utf8
BEGIN
DECLARE userNames VARCHAR(1000);
SELECT GROUP_CONCAT(USER_NAME) INTO userNames FROM t_users WHERE  FIND_IN_SET(USER_ID,REPLACE(userIds,' ',''));
RETURN userNames;
END//
DELIMITER ;


