  `REG_CAPITAL` decimal(20,5) DEFAULT NULL COMMENT '注册资本',
  `REG_ID` varchar(50) DEFAULT NULL COMMENT '注册编号',
  `EMP_AMOUNT` int(10) DEFAULT NULL COMMENT '员工数量',
  `CREATOR` varchar(40) DEFAULT NULL COMMENT '创建人为当前录入公司单位信息的操作人员ID',
  `CREATE_DATE` datetime DEFAULT NULL COMMENT '创建日期',
