  `RENT` decimal(20,5) DEFAULT NULL COMMENT '房租，若借款人的房屋居住状况为下述B和C的状况，则此处房租为一个数值，否则，为NULL。\n            B：自由房屋，有贷款（借款人信息表中有专门的字段存储月供金额）。\n            C：租房（借款人信息表中有专门的字段存储房租金额）。\n            \n            \n            ',
  `CREATE_DATE` datetime DEFAULT NULL COMMENT '借款人创建日期',
