  `LOANER_POSTAL_ADDR` varchar(200) DEFAULT NULL COMMENT '贷款人通讯地址',
  `LOANER_TEL` varchar(20) DEFAULT NULL COMMENT '贷款人联系电话',
  `LOANER_SIGN_DATE` date DEFAULT NULL COMMENT '贷款人签字日期',
  `LOANER_JOINT` varchar(20) DEFAULT NULL COMMENT '共同贷款人姓名',
  `LJ_IDNO` varchar(32) DEFAULT NULL COMMENT '共同贷款人身份证号',
  `LJ_POSTAL_ADDR` varchar(200) DEFAULT NULL COMMENT '共同贷款人通讯地址',
  `LJ_TEL` varchar(20) DEFAULT NULL COMMENT '共同贷款人联系电话',
  `LJ_SIGN_DATE` date DEFAULT NULL COMMENT '共同贷款人签字日期',
  `LENDER` varchar(20) DEFAULT NULL COMMENT '出借人，目前固定为于德建',
  `LENDER_IDNO` varchar(32) DEFAULT NULL COMMENT '出借人身份证号，目前固定为131126197912150054',
  `LENDER_SIGN_DATE` date DEFAULT NULL COMMENT '出借人签字日期',
  `AGENT` varchar(20) DEFAULT NULL COMMENT '委托代理人姓名，有则填写，否则无',
  `AGENT_IDNO` varchar(32) DEFAULT NULL COMMENT '委托代理人身份证号',
  `AGENT_SIGN_DATE` date DEFAULT NULL COMMENT '委托代理人签字日期',
  `PURPOSE` varchar(100) DEFAULT NULL COMMENT '贷款用途',
  `LOAN_EDU` decimal(20,5) DEFAULT NULL COMMENT '贷款额度，合同金额',
  `MONTHLY_RATE` decimal(5,2) DEFAULT NULL COMMENT '月利率，目前固定为1%（年利率12%）',
  `LOAN_INTEREST` decimal(20,5) DEFAULT NULL COMMENT '贷款利息，贷款利息＝合同金额*月利率',
  `MONTHLY_REPAYMENT` decimal(20,5) DEFAULT NULL COMMENT '月还款额度，每月还本金和利息总和。计息公式如下(合同金额/贷款期数)+合同金额*月利率',
  `LOAN_PERIODS` int(2) DEFAULT NULL COMMENT '贷款期数，目前可选贷款期数为6期和12期',
  `OBLI_MATCH_STATUS` char(1) DEFAULT '0' COMMENT '债权匹配状态，查询系统参数表（t_sys_parameter）中parm_code=obligation_status的数据记录，取值范围包括：0－未匹配，1－已匹配',
  `MONTHLY_REPAYMENT_DATE` int(2) DEFAULT NULL COMMENT '月还款日，如果批贷日期在当月15号之前的，还款日为30号，否则为15号。',
  `IS_AHEAD_REPAYMENT` char(1) DEFAULT NULL COMMENT '是否提前还款，取值范围：0－是，1－否，OA系统中特批申请流程审批通过后系统自动更新该值为0',
  `REPAYMENT_DATE` date DEFAULT NULL COMMENT '提前还款日期，只有当是否提前还款为0时记录数据，否则为空，OA系统中特批申请流程审批通过后系统自动将申请单上申请还款日期更新到该字段',
  `LOAN_BG_DATE` date DEFAULT NULL COMMENT '贷款开始日期，为合同签约日期',
  `LOAN_ED_DATE` date DEFAULT NULL COMMENT '贷款结束日期，合同履行终止日期',
  `REPAYMENT_BG_DATE` date DEFAULT NULL COMMENT '还款开始日期',
  `REPAYMENT_ED_DATE` date DEFAULT NULL COMMENT '还款结束日期',
  `LOANER_BANK_NAME` varchar(80) DEFAULT NULL COMMENT '贷款人开户银行全称',
  `LOANER_ACT_NAME` varchar(32) DEFAULT NULL COMMENT '贷款人开户行户名，账户名称',
  `LOANER_ACT_NUM` varchar(32) DEFAULT NULL COMMENT '贷款人开户行账号',
  `CONTRACT_STATUS` char(1) DEFAULT NULL COMMENT '合同状态，查询系统字典表（t_sys_dict）中所有parent_id等于dict_code=contract_status的记录的code_id，取值范围为0－初始状态，1－已签约，2－客户拒签，3－作废',
  `REMARK` varchar(100) DEFAULT NULL COMMENT '备注信息',
  PRIMARY KEY (`LC_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='贷款业务合同表，记录贷款业务与贷款人签署的合同详细信息';

