DROP TABLE IF EXISTS `t_bp_loan_cust_repayment_detail`;
CREATE TABLE IF NOT EXISTS `t_bp_loan_cust_repayment_detail` (
  `RD_ID` varchar(40) NOT NULL COMMENT '还款明细ID',
  `CONTRACT_NO` varchar(50) NOT NULL COMMENT '贷款合同编号',
  `PERIODS` int(2) NOT NULL COMMENT '期数，每期贷款期数的编号',
  `PLAN_REPMT_DATE` date DEFAULT NULL COMMENT '应还款日期，每期正常还款的日期',
  `PLAN_REPMT_AMT` decimal(10,2) DEFAULT NULL COMMENT '应还款金额，如果未产生逾期，则应该还款金额等于月还金额，否则应该还款金额等于滞纳金加上罚息',
  `REAL_REPMT_DATE` date DEFAULT NULL COMMENT '实际还款日期，由于可能存在当期多次还款的情况，因此只记录最后一次还款日期。',
  `REAL_REPMT_AMT` decimal(10,2) DEFAULT NULL COMMENT '实际还款金额，由于可能存在当期多次还款的情况，因此只记录最后一次还款金额。 ',
  `REPMT_ACT` varchar(32) DEFAULT NULL COMMENT '还款账号，由于可能存在当期多次还款的情况，因此只记录最后一次还款的账号信息。',
  `OVERDUE_DAYS` int(11) DEFAULT NULL COMMENT '逾期天数，记录当期累计逾期天数，到月末将不再累计',
  `LATE_FEE` decimal(10,2) DEFAULT NULL COMMENT '滞纳金，如果产生逾期，则需要计算滞纳金，公式为月还金额*0.1，滞纳金每次只收取一次，未还清的话，即使下期还款再产生逾期，也不会计算，否则反之。',
  `DEFAULT_INTEREST` decimal(10,2) DEFAULT NULL COMMENT '罚息，计算公式为月还金额*0.0005*分期期数*逾期天数（累计）',
  `FREE_INTEREST_FEE` decimal(10,2) DEFAULT NULL COMMENT '免息金额，只能免除部分或全部滞纳金或罚息，应还款金额等于实际还款金额加上免息金额',
  `RPMT_STATUS` char(1) DEFAULT NULL COMMENT '还款状态，记录当期最终的还款状态，页面展示查询系统字典表（t_sys_dict），查询出所有上级数据字典ID（parent_id）为字典编码（code）等于repmt_status的字典ID（code_id）的数据。\n            取值范围：0－未还款，1－还款中，2－本期已还，3－已转催收',
  `OPERATOR` varchar(40) DEFAULT NULL COMMENT '操作人员，业务操作人员',
  `REMARK` varchar(100) DEFAULT NULL COMMENT '备注信息',
  PRIMARY KEY (`RD_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='该表记录了贷款客户每期的还款明细信息';

