  `LOAN_TYPE` varchar(10) DEFAULT NULL COMMENT '贷款类型，从t_sys_dict中查找dict_code=loan_type的ID值，再找出以该ID值为父ID的所有数据，是一个树形结构。\n            A：事业贷（即放贷给个人业主，小老板），\n            B：工薪贷（即放贷给工薪阶层人员）。\n            ',
  `LOAN_AMOUNT` decimal(20,5) DEFAULT NULL COMMENT '申请贷款额度',
  `LOAN_MIN` decimal(20,5) DEFAULT NULL COMMENT '最低接受额度',
  `LOAN_PERIOD` int(11) DEFAULT NULL COMMENT '申请贷款期限，单位：月',
  `REPAY_METHOD` char(1) DEFAULT NULL COMMENT '还款方式，从t_sys_dict中查找dict_code=repay_method的ID值，再找出以该ID值为父ID的所有数据，是一个树形结构。\n            A：独立还款，B：家人协助还款，C：其他还款方式\n            ',
  `PURPOSE` varchar(100) DEFAULT NULL COMMENT '贷款用途',
  `SALESMAN` varchar(40) DEFAULT NULL COMMENT '业务员是当前订单的最初受理人，此处记录用户ID',
  `CREATOR` varchar(40) DEFAULT NULL COMMENT '登记人是当前登录系统并填写申请的企业内部用户，此处记录该用户ID',
  `ORGANIZATION_ID` int(11) DEFAULT NULL,
  `CREATE_DATE` datetime DEFAULT NULL COMMENT '记录贷款订单生成日期',
  `FINISH_DATE` datetime DEFAULT NULL COMMENT '记录订单最终结束日期',
  `APPLY_DATE` date DEFAULT NULL COMMENT '贷款客户申请贷款日期',
  `NAME` varchar(200) DEFAULT NULL COMMENT '贷款人姓名',
  `GENDER_TYPE` char(1) DEFAULT NULL COMMENT '借款人性别，先从t_sys_dict中查找dict_code=gender_type的ID值，再找出以该ID值为父ID的所有数据，是一个树形结构。\n            M：男，F：女。\n            ',
  `ID_NO` varchar(32) DEFAULT NULL COMMENT '身份证号',
  `AGE` int(3) DEFAULT NULL COMMENT '年龄',
  `HUKOU_ADDR` varchar(40) DEFAULT NULL COMMENT '户籍地址关联地址详情表（t_bp_address）中宿主ID（host_id）为当前人的ID，地址类别（addr_type）为“户籍地址(1)”的并且对应宿主类型的地址ID',
  `CUR_ADDR` varchar(40) DEFAULT NULL COMMENT '现住地址关联地址详情表（t_bp_address）中宿主ID（host_id）为当前人的ID，地址类别（addr_type）为“现住地址(2)”的并且对应宿主类型的地址ID',
  `MOBILE_TEL` varchar(20) DEFAULT NULL COMMENT '手机号码',
  `FIXED_TEL` varchar(20) DEFAULT NULL COMMENT '住址电话',
  `MARRIAGE_TYPE` char(1) DEFAULT NULL COMMENT '婚姻状况，从t_sys_dict中查找dict_code=marriage_type的ID值，再找出以该ID值为父ID的所有数据，是一个树形结构。\n            Y：表示结婚，\n            N：表示未婚。\n            ',
  `HAS_CHILD` char(1) DEFAULT NULL COMMENT '是否有子女，先从t_sys_dict中查找dict_code=has_child的ID值，再找出以该ID值为父ID的所有数据，是一个树形结构。\n            Y：表示有子女，\n            N：表示无子女。\n            Z：抚/赡三代\n            ',
  `EMAIL` varchar(300) DEFAULT NULL COMMENT '邮箱',
  `QQ_NO` varchar(30) DEFAULT NULL COMMENT 'QQ号',
  `ANNUAL_SALARY` decimal(20,5) DEFAULT NULL COMMENT '年收入',
  `INCOME_SRC` varchar(200) DEFAULT NULL COMMENT '收入来源',
  `MORTGAGE_STATUS` char(1) DEFAULT NULL COMMENT '房屋居住状况：从t_sys_dict中查找dict_code=mortgage_status的ID值，再找出以该ID值为父ID的所有数据，是一个树形结构。\n            A：自有房屋，没有贷款。\n            B：自由房屋，有贷款（借款人信息表中有专门的字段存储月供金额）。\n            C：租房（借款人信息表中有专门的字段存储房租金额）。\n            D：亲属房产。\n            E：其他说明。',
  `HOUSE_INSTALL_PAY` decimal(20,5) DEFAULT NULL COMMENT '月供，若借款人的房屋居住状况为下述B和C的状况，则此处房租为一个数值，否则，为NULL。\n            B：自由房屋，有贷款（借款人信息表中有专门的字段存储月供金额）。\n            C：租房（借款人信息表中有专门的字段存储房租金额）。\n            ',
  `RENT` decimal(20,5) DEFAULT NULL COMMENT '房租，若借款人的房屋居住状况为下述B和C的状况，则此处房租为一个数值，否则，为NULL。\n            B：自由房屋，有贷款（借款人信息表中有专门的字段存储月供金额）。\n            C：租房（借款人信息表中有专门的字段存储房租金额）。\n            \n            \n            ',
  `PROCESS_STATUS` varchar(10) DEFAULT NULL COMMENT '记录流程整体状态，0－未开启，1－已开启，2－已结束',
  `TASK_ALLOT_CNT` bigint(20) DEFAULT NULL COMMENT '任务分发计数器',
  `BELONG_TO` varchar(20) DEFAULT NULL COMMENT '订单属主，记录当前订单所属IPC还是信审',
  `LOAN_INFO` char(1) DEFAULT '1' COMMENT '进件情况，取值范围：1－第一次，2－循环贷，3－二次进件，默认为1',
  `DEP_MENAGER` varchar(100) DEFAULT NULL COMMENT '部门主管，记录部门主管用户编号',
  `SIGN_DATE` date DEFAULT NULL COMMENT '部门主管签字日期',
  PRIMARY KEY (`LOAN_ORDER_ID`),
  KEY `FK_Reference_21` (`STATUS_ID`),
  KEY `FK_Reference_32` (`LOANER_ID`),
  CONSTRAINT `FK_Reference_21` FOREIGN KEY (`STATUS_ID`) REFERENCES `t_bp_order_status` (`STATUS_ID`),
  CONSTRAINT `FK_Reference_32` FOREIGN KEY (`LOANER_ID`) REFERENCES `t_bp_loaner` (`LOANER_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

